import React from 'react';
// Styles
import { InfoStyles } from './Info.styles';

const Info = () => (
  <InfoStyles>
    <p>
      洞察者號(InSight)正在探測火星的Elysium平原,位於火星赤道)的天氣數據,包括溫度,風向,氣壓等.終究一天人類殖民火星..
    </p>
    <p>
      這些氣候數據只是探測任務的一部分
      <a href='https://mars.nasa.gov/insight/mission/overview/'>點擊NASA 洞察者任務</a>了解更多</p>
  </InfoStyles>
);

export default Info;
